using namespace std;
class Solution {
public:
	vector<int> twoSum(vector<int>& numbers, int target) {
		vector<int> res;
		int l = 0, r = numbers.size() - 1;
		for (int i = 0; i < numbers.size(); ++i)
		{
			if (numbers[l] + numbers[r] == target)
				res = { l + 1, r + 1 };
			else if (numbers[l] + numbers[r] < target)
				++l;
			else
				--r;
		}

		return res;
	}
};
//下面两种方法正确，但最后一个测试用例超时
//双重循环，时间复杂度O(n2)
class Solution1 {
public:
	vector<int> twoSum(vector<int>& numbers, int target) {
		vector<int> res;
		for (int i = 0; i < numbers.size(); ++i)
		{
			for (int j = i + 1; j < numbers.size(); ++j)
				if (numbers[i] + numbers[j] == target)
					res = { i + 1, j + 1 };
		}

		return res;
	}
};
//二分查找，时间复杂度O(nlogn)
class Solution2 {
public:
	vector<int> twoSum(vector<int>& numbers, int target) {
		vector<int> res;
		for (int i = 0; i < numbers.size(); ++i)
		{
			vector<int> arr(numbers.begin() + i + 1, numbers.end());
			int n;
			if ((n = binarySearch(arr, target - numbers[i])) != -1)
			{
				res.push_back(i + 1);
				res.push_back(n + 1 + i + 1);
				break;
			}

		}
		return res;

	}
	int binarySearch(vector<int>& arr, int t)
	{
		int l = 0, r = arr.size() - 1;
		while (l <= r)
		{
			int mid = (l + r) / 2;
			if (arr[mid] == t)
				return mid;
			else if (arr[mid] < t)
				l = mid + 1;
			else
				r = mid - 1;
		}
		return -1;
	}
};
